import React, { Component } from 'react';

import './SideMenu.css';

export default class User extends Component {
	render() {
		const { visible } = this.props;

		if (visible)
			return (
				<div className="sideMenuContainer">
					<i className="fa fa-right-arrow" onClick={this.props.hideMenu} />
					<div className="userFullName">{this.props.userFullName}</div>
				</div>
			);
		else return <div />;
	}
}
